import{PaidLeaveGraphModel}from"../../model/graph/paid-leave-graph-model.js";import{Utility}from"../../shared/utility.js";import ScriptSeriesLoader from"../../shared/script-series-loader.js";class PaidLeaveGraphController{constructor(){this.model=new PaidLeaveGraphModel,this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://cdn.plot.ly/plotly-latest.min.js"),this.scriptLoader.load()}static build=async()=>{const e=new PaidLeaveGraphController;for(;e.scriptLoader.running;)await Utility.sleep(2e3);return e};execute=()=>{const e=this.model.getActual(),t=[{mode:"scatter",name:"実績",x:e.map((e=>e.yearMonth)),y:e.map((e=>e.value))}];Plotly.newPlot("graph-container",t,{title:"有給休暇"})}}export{PaidLeaveGraphController};